import React, { useEffect } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import AOS from 'aos'; // Import AOS for animations
import carRental from '../../assets/car-rental.jpg';
import comfortableStays from '../../assets/comfortable-stays.jpg';
import dubaiBeauty from '../../assets/dubai-beauty.jpg';
import excitingAdventures from '../../assets/exciting-adventures.jpg';
import exploreGeorgia from '../../assets/explore-georgia.jpg';
// import './Gallery.css';
import './Home.css';





const galleryImages = [
  { id: 1, src: exploreGeorgia, alt: 'Explore Georgia', className: 'large' },
  { id: 2, src: dubaiBeauty, alt: 'Beautiful Destinations', className: 'small' },
  { id: 3, src: comfortableStays, alt: 'Comfortable Stays', className: 'large' },
  { id: 4, src: excitingAdventures, alt: 'Exciting Adventures', className: 'medium' },
  { id: 5, src: carRental, alt: 'Car Rentals', className: 'small' },
  // Add more images as needed
];




const Home = () => {
  useEffect(() => {
    AOS.init({ duration: 1000 }); // Initialize AOS and set default animation duration
  }, []);

  const carouselItemStyle = {
    height: '31rem',
  };

  const imgStyle = {
    height: '100%',
    objectFit: 'cover',
  };

  const captionStyle = {
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
    padding: '1rem',
  };

  const galleryImages = [
    { id: 1, src: exploreGeorgia, alt: 'Explore Georgia' },
    { id: 2, src: dubaiBeauty, alt: 'Beautiful Destinations' },
    { id: 3, src: comfortableStays, alt: 'Comfortable Stays' },
    { id: 4, src: excitingAdventures, alt: 'Exciting Adventures' },
    { id: 5, src: carRental, alt: 'Car Rentals' },
    // Add more images as needed
  ];

  return (
    <>
      <div id="carouselExampleIndicators" className="carousel slide" data-bs-ride="carousel" data-bs-interval="2000">
        <div className="carousel-indicators">
          <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="0" className="active" aria-current="true" aria-label="Slide 1"></button>
          <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="1" aria-label="Slide 2"></button>
          <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="2" aria-label="Slide 3"></button>
          <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="3" aria-label="Slide 4"></button>
          <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="4" aria-label="Slide 5"></button>
        </div>
        <div className="carousel-inner" style={{ position: 'static' }}>
          <div className="carousel-item active" style={carouselItemStyle}>
            <img src={exploreGeorgia} className="d-block w-100" alt="Explore Georgia" style={imgStyle} />
            <div className="carousel-caption d-none d-md-block" data-aos="fade-up" style={captionStyle}>
              <h5>Explore Georgia</h5>
              <p>Your adventure awaits!</p>
            </div>
          </div>
          <div className="carousel-item" style={carouselItemStyle}>
            <img src={dubaiBeauty} className="d-block w-100" alt="Beautiful Destinations" style={imgStyle} />
            <div className="carousel-caption d-none d-md-block" data-aos="fade-up" style={captionStyle}>
              <h5>Beautiful Destinations</h5>
              <p>Discover the beauty of Dubai and beyond.</p>
            </div>
          </div>
          <div className="carousel-item" style={carouselItemStyle}>
            <img src={comfortableStays} className="d-block w-100" alt="Comfortable Stays" style={imgStyle} />
            <div className="carousel-caption d-none d-md-block" data-aos="fade-up" style={captionStyle}>
              <h5>Comfortable Stays</h5>
              <p>Stay in style and comfort during your travels.</p>
            </div>
          </div>
          <div className="carousel-item" style={carouselItemStyle}>
            <img src={excitingAdventures} className="d-block w-100" alt="Exciting Adventures" style={imgStyle} />
            <div className="carousel-caption d-none d-md-block" data-aos="fade-up" style={captionStyle}>
              <h5>Exciting Adventures</h5>
              <p>Embark on the best tours with Adventure Tales World.</p>
            </div>
          </div>
          <div className="carousel-item" style={carouselItemStyle}>
            <img src={carRental} className="d-block w-100" alt="Car Rentals" style={imgStyle} />
            <div className="carousel-caption d-none d-md-block" data-aos="fade-up" style={captionStyle}>
              <h5>Car Rentals</h5>
              <p>Explore the city at your own pace with our car rental services.</p>
            </div>
          </div>
        </div>
        <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Previous</span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Next</span>
        </button>
      </div>

      /Gallery Section
<section className="gallery py-5">
  <div className="container">
    <h2 className="text-center mb-4">Top Tourism Places in Georgia</h2>
    <div className="gallery-grid">
      {galleryImages.map((image) => (
        <div className={`gallery-item ${image.className}`} key={image.id}>
          <img src={image.src} alt={image.alt} className="img-fluid" />
          <div className="overlay">
            <h4>{image.alt}</h4>
          </div>
        </div>
      ))}
    </div>
  </div>
</section>


    </>
  );
};

export default Home;
